import React, { useState, useEffect } from "react";
import { Grid, TextField, makeStyles } from '@material-ui/core';


const useStyle = makeStyles(theme => ({
  root: {

  }
})
)

const initialValues = {
  id: 0,
  title: "",
  price: "",
  vehicles: "",
  city: "",
  river: "",
  postalCode: "",
  street: "",
  streetNumber: "",
  description: "",
  imageURL: "",
};

export default function AddNewOfferForm() {
  const [values, setValues] = useState(initialValues);
  const classes = useStyle();
  return (
    <form className = {classes.root}> 
      <Grid container>
        <Grid item xs={6}>
            <TextField
            variant="outlined"
            label="Jak się nazywa Twoja firma?"
            value={values.title}
            />
             <TextField
            variant="outlined"
            label="Ile kosztuje wypożyczenie?"
            value={values.price}
            />
             <TextField
            variant="outlined"
            label="W jakim mieście?"
            value={values.city}
            />
             <TextField
            variant="outlined"
            label="Na jakiej wodzie?"
            value={values.rier}
            />
             <TextField
            variant="outlined"
            label="Podaj kod pocztowy."
            value={values.postalCode}
            />
             <TextField
            variant="outlined"
            label="Na jakiej ulicy?"
            value={values.street}
            />
              <TextField
            variant="outlined"
            label="Jaki jest numer lokalu?"
            value={values.streetNumber}
            />
             <TextField
            variant="outlined"
            label="Napisz coś więcej :)"
            value={values.description}
            />

        </Grid>
        <Grid item xs={6}></Grid>
      </Grid>
    </form>
  );
}
